            __html: '<h2 id="总结">总结<a class="anchor" href="Pastebin/Conclusion.html#总结">§</a></h2>\n<p>就这样！确保已安装所有路由并测试应用程序。你现在写了一个简单的（~75行！）火箭里的巴斯特宾！这个小应用程序有许多潜在的改进，我们鼓励您通过其中的一些改进来更好地了解Rocket。以下是一些想法：</p>\n<ul>\n<li>在索引中添加一个web表单，用户可以在其中手动输入新的粘贴。在<code>POST/</code>接受表单。使用<code>format</code>和<code>/</code>或<code>rank</code>指定应调用两个<code>POST/routes</code>中的哪一个。</li>\n<li>通过添加新的<code>DELETE/&lt;id&gt;</code>路由，支持删除粘贴。使用<code>PasteID</code>验证<code>&lt;id&gt;</code>。</li>\n<li>将上传限制为最大大小。如果上载超过该大小，则返回206部分状态代码。否则，返回201创建的状态代码。</li>\n<li>在 <code>upload</code> 和 <code>retrieve</code> 中设置返回值的 <code>Content-Type</code> 为 <code>text/plain</code>。</li>\n<li>每次上传后返回一个唯一的 <strong>&quot;key&quot;</strong> ，并要求在执行删除时key存在并匹配。使用Rocket的一个核心特征来进行关键验证。</li>\n<li>添加一个<code>PUT /&lt;id&gt;</code>路由，允许用户用“ <code>&lt;id&gt;</code> ”键替换现有的粘贴（如果有的话）。</li>\n<li>添加一个新路由，<code>GET/&lt;id&gt;/&lt;lang&gt;</code>该语法突出显示了语言<code>&lt;lang&gt;</code>的ID<code>&lt;id&gt;</code>粘贴。如果<code>&lt;lang&gt;</code>不是已知语言，请不要突出显示。可能用<code>FromParam</code>验证<code>&lt;lang&gt;</code>。</li>\n<li>使用该<a href="https://api.rocket.rs/v0.4/rocket/local/"><code>local</code>模块</a>为您的pastebin编写单元测试。</li>\n<li>在进入<code>launch</code>Rocket 之前先分配一个线程，<code>main</code>以便定期清理<code>upload/</code>中空闲的旧粘贴。</li>\n</ul>\n<p>您可以<a href="https://github.com/SergioBenitez/Rocket/tree/v0.4/examples/pastebin">在GitHub上找到完整的pastebin教程</a>的完整源代码。</p>'
